import React, { useState } from "react";
import './auth.scss';

const Login: React.FC = () => {
  const [loginID, setLoginID] = useState<string>('');

  const handleUserId = (e: any) => setLoginID(e.target.value);

  return (
    <div className="main">
      <h1>User Login</h1>\
      <input type="text" value={loginID} name='UserId' onClick={handleUserId} />
    </div>
  )
};

export default Login;
